import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const manga = [
    {name: 'JoJo Bizarre Adventure', by: 'Hirohiko Araki'},
    {name: 'Deadman Wonderland', by: 'Jinsei Kataoka'},
    {name: 'Flcl', by: 'Kazuya Tsurumaki and Yōji Enokido'},
    {name: 'Case Closed', by: 'Gosho Aoyama'},
    {name: 'The way of a Househusband', by: 'Kousuke Oono'},
    {name: 'Blue Exorcist', by: 'Kazue Kato'},
    {name: 'Letter Bee', by: 'Hiroyuki Asada'},
    {name: 'Monster', by: 'Naoki Urasawa'},
    {name: 'Berserk', by: 'Kentaro Miura and Kouji Mori'},
    {name: 'Pandora Hearts', by: 'Jun Mochizuki'},
    {name: 'Death Note', by: 'Tsugumi Ohba'}
  ];
  return (
    <div className='container'>
      <h1>Hello World</h1>
    </div>
  );
}

export default App;
